import logo from './logo.svg';
import './App.css';
import TextBox from './TextBox'
import React, {useState} from 'react'

function Route() {
  function handleStartLat(event, value) {
    setStartLat(value)
  }
  const [startLat, setStartLat] = useState(0);
  const [startLon, setStartLon] = useState(0);
  const [endLat, setEndLat] = useState(0);
  const [endLon, setEndLon] = useState(0);
  return (
    <div className="Route">
      <header className="Route-header">
        <title>This is a title</title>
      </header>
        <TextBox label={"Start Latitude"} change = {setStartLat}/>
        <TextBox label={"Start Longitude"} change = {setStartLon(event)}/>
        <TextBox label={"End Latitude"} change = {setEndLat(event)}/>
        <TextBox label={"End Longitude"} change = {setEndLon(event)}/>
    </div>
  );
}
export default Route;
